(147, 'Pukerian Scrolls', 'assets/frontpage/img/shop/item_mall/pukerian-scrolls.png', 4, 1, 0, '<p>Protect equipment up to +10, Enchanting equipment might fail.<br></p>', 0, '', 1, 0, 0),
(148, 'Guild Wizard Scrolls', 'assets/frontpage/img/shop/item_mall/guild-wizard-scrolls.png', 4, 1, 0, '<p>Protecting item from enchant up to +15. If enchant fail the upgrade level will decrease by 1.<br></p>', 0, '', 1, 0, 0),
(151, 'Black Magic Box', 'assets/frontpage/img/shop/item_mall/black-magic-box.png', 4, 1, 0, '<p style=\"text-align: justify; \">box contains mysterious items, if you are lucky you can get epic items<br></p>', 0, '', 0, 0, 0),
(152, 'Red Magic Box', 'assets/frontpage/img/shop/item_mall/red-magic-box.png', 4, 1, 0, '<p><span style=\"font-family: &quot;Apercu Pro&quot;; text-align: justify;\">box contains mysterious items, if you are lucky you can get epic items</span><br></p>', 0, '', 0, 0, 0),
(153, 'Blue Magic Box', 'assets/frontpage/img/shop/item_mall/blue-magic-box.png', 4, 1, 0, '<p><span style=\"font-family: &quot;Apercu Pro&quot;; text-align: justify;\">box contains mysterious items, if you are lucky you can get epic items</span><br></p>', 0, '', 0, 0, 0),
(156, '[CN] EXP 20% (1 day)', 'assets/frontpage/img/shop/item_mall/cn-exp-20-1-day.png', 4, 1, 0, '<p><span style=\"color: rgb(123, 123, 123); font-family: &quot;Noto Sans&quot;, sans-serif; font-size: 14px; text-align: justify;\">A scroll that increases your experience points by 20% for 1 hour.</span><br></p>', 0, '', 0, 0, 0),
(157, '[CN] EXP 50% (1 day)', 'assets/frontpage/img/shop/item_mall/cn-exp-50-1-day.png', 4, 1, 0, '<p><span style=\"color: rgb(123, 123, 123); font-family: &quot;Noto Sans&quot;, sans-serif; font-size: 14px; text-align: justify;\">A scroll that increases your experience points by 50% for 1 hour.</span><br></p>', 0, '', 0, 0, 0),
(158, 'Ticket Salon', 'assets/frontpage/img/shop/item_mall/beauty-salon-ticket.png', 4, 0, 0, '<p><span style=\"color: rgb(123, 123, 123); font-family: &quot;Noto Sans&quot;, sans-serif; font-size: 14px;\">Use this to change your hair and face options, with access to premium styles.</span><br></p>', 0, '', 1, 0, 0),
(159, 'Great Inventory', 'assets/frontpage/img/shop/item_mall/mythic-inventory-expansion-scroll.png', 4, 0, 0, '<p>When used character\'s bag slot will be expanded.<br></p>', 0, '', 1, 0, 0),
(160, 'Charging Berseker Amulet', 'assets/frontpage/img/shop/item_mall/charging-berseker-amulet.png', 4, 1, 0, '<p><span style=\"color: rgb(123, 123, 123); font-family: &quot;Noto Sans&quot;, sans-serif; font-size: 14px;\">This amulet is only effective on wing items. Double click the amulet, place the wing item inside, and click \'give option\' to enchant the wing item with up to 10 strength (STR) and/or 3% physical attack. Using it again will erase the previous effect and give a different one.</span><br></p>', 0, '', 1, 0, 0),
(161, 'Keen Assasin Amulet', 'assets/frontpage/img/shop/item_mall/keen-assasin-amulet.png', 4, 1, 0, '<p><span style=\"color: rgb(123, 123, 123); font-family: &quot;Noto Sans&quot;, sans-serif; font-size: 14px;\">This amulet is only effective on wing items. Double click the amulet, place the wing item inside, and click \'give option\' to enchant the wing item with up to 10 dexterity and 50 critical value. Using it again will erase the previous effect and give a different one</span><br></p>', 0, '', 1, 0, 0),
(162, 'Wise Great Philosopher\'s Amulet', 'assets/frontpage/img/shop/item_mall/wise-great-philosopher-s-amulet.png', 4, 1, 0, '<p><span style=\"color: rgb(123, 123, 123); font-family: &quot;Noto Sans&quot;, sans-serif; font-size: 14px;\">This amulet is only effective on wing items. Double click the amulet, place the wing item inside, and click \'give option\' to enchant the wing item with up to 10 intelligence (INT) and/or 5% magical power. Using it again will erase the previous effect and give a different one.</span><br></p>', 0, '', 1, 0, 0),
(163, 'Affectionate Guardian\'s Amulet', 'assets/frontpage/img/shop/item_mall/affectionate-guardian-s-amulet.png', 4, 1, 0, '<p><span style=\"color: rgb(123, 123, 123); font-family: &quot;Noto Sans&quot;, sans-serif; font-size: 14px;\">This amulet is only effective on wing items. Double click the amulet, place the wing item inside, and click \'give option\' to enchant the wing item with up to 10 vitality (VIT) and/or 10 wisdom (WIS). Using it again will erase the previous effect and give a different one.</span><br></p>', 0, '', 1, 0, 0),
(164, 'HC Orichalcum', 'assets/frontpage/img/shop/item_mall/hc-orichalcum.png', 4, 1, 0, '<p><span style=\"color: rgb(123, 123, 123); font-family: &quot;Noto Sans&quot;, sans-serif; font-size: 14px;\">Highly concentrated orichalcum used to reinforce rings, necklaces, earrings and belts. Increases physical attack power by 10-20.</span><br></p>', 0, '', 1, 0, 0),
(165, 'HC Moonstone', 'assets/frontpage/img/shop/item_mall/hc-moonstone.png', 4, 1, 0, '<p><span style=\"color: rgb(123, 123, 123); font-family: &quot;Noto Sans&quot;, sans-serif; font-size: 14px;\">Highly concentrated moonstone used to reinforce rings, necklaces, earrings and belts. Increases magical attack by 10-20.</span><br></p>', 0, '', 1, 0, 0),
(166, 'HC Crystal Of Thunder', 'assets/frontpage/img/shop/item_mall/hc-crystal-of-thunder.png', 4, 1, 0, '<p><span style=\"color: rgb(123, 123, 123); font-family: &quot;Noto Sans&quot;, sans-serif; font-size: 14px;\">Highly concentrated thunder crystal used to reinforce rings, necklaces, earrings and belts. Increases accuracy rate by 5-10 points.</span><br></p>', 0, '', 1, 0, 0),
(167, 'HC Fairy\'s Wing', 'assets/frontpage/img/shop/item_mall/hc-fairy-s-wing.png', 4, 1, 0, '<p><span style=\"color: rgb(123, 123, 123); font-family: &quot;Noto Sans&quot;, sans-serif; font-size: 14px;\">Highly concentrated fairy\'s wing used to reinforce rings, necklaces, earrings and belts. Increases movement speed by 25-50 points.</span><br></p>', 0, '', 1, 0, 0),
(168, 'Blessed Pukerian\'s Scroll', 'assets/frontpage/img/shop/item_mall/blessed-pukerian-s-scroll.png', 4, 1, 0, '<p><span style=\"color: rgb(123, 123, 123); font-family: &quot;Noto Sans&quot;, sans-serif; font-size: 14px;\">An enchant protection scroll usable on items from +1 to +12, has an enchantment success rate of 100%.</span><br></p>', 0, '', 0, 0, 0),
(169, '100% Exp 1hour', 'assets/frontpage/img/shop/item_mall/100-exp-1hour.png', 4, 1, 0, '<p><span style=\"color: rgb(123, 123, 123); font-family: &quot;Noto Sans&quot;, sans-serif; font-size: 14px;\">A scroll that increases your experience points by 100% for 1 hour.</span><br></p>', 0, '', 1, 0, 0),
(170, 'Stat Reset Scroll', 'assets/frontpage/img/shop/item_mall/stat-reset-scroll.png', 4, 1, 0, '<p><span style=\"color: rgb(123, 123, 123); font-family: &quot;Noto Sans&quot;, sans-serif; font-size: 14px;\">Resets your stats, refunding all stat points spent. Usable for all levels.</span><br></p>', 0, '', 1, 0, 0),
(171, 'Skill Reset Scroll', 'assets/frontpage/img/shop/item_mall/skill-reset-scroll.png', 4, 1, 0, '<p><span style=\"color: rgb(123, 123, 123); font-family: &quot;Noto Sans&quot;, sans-serif; font-size: 14px;\">Resets your skills, refunding all SP &amp; gold spent. After activating this item, you will be automatically reconnected to the game. Works for all levels.</span><br></p>', 0, '', 1, 0, 0),
