INSERT INTO `news` (`id`, `title`, `category`, `url`, `is_active`, `content`, `img`, `date`) VALUES
(4, 'Terms OF Services', 'Page', 'terms-of-services', 'yes', '<p align=\"justify\"></p><p align=\"justify\"></p><p class=\"MsoNormal\" style=\"text-align:center\" align=\"center\"><b><span style=\"color: rgb(255, 255, 255);\"><span style=\"background-color: inherit;\"><span style=\"font-size: 27pt; font-family: inherit;\">Terms\r\nof Service</span></span></span></b></p><p class=\"MsoNormal\" style=\"text-align:center\" align=\"center\"><span style=\"color: rgb(255, 255, 255);\"><span style=\"background-color: inherit;\"><br></span></span></p><span style=\"font-weight: bold;\"><span style=\"color: rgb(255, 255, 255);\"><span style=\"background-color: inherit;\">All Rules In Great Luna, we can add or modified all rules if we need<br>GM Decision is absolute</span></span></span><p align=\"justify\"></p><p align=\"justify\"><br></p><p align=\"justify\"><span style=\"color: rgb(11, 46, 182);\"><span style=\"background-color: inherit;\">1. Using clients outside the GREAT LUNA is strictly prohibited<br>* Punishment: Permanently Banned<br><br>2. It is prohibited to impersonate a GREAT LUNA Staff member<br>* Punishment: Permanently Banned<br><br>3. It is prohibited to distribute / promote other games within the GREAT LUNA<br>* Punishment: Permanently Banned<br><br>4. Prohibited from saying racist words, harassing / insulting parents / countries, discriminating against players from different countries, insulting GM / STAFF<br>* Punishment: Permanently Banned<br><br>5. It is forbidden to intentionally hide monsters in any map<br>* Penalty: 1 Day - 7 Days Banned<br><br>6. Registration of Guild Tournament Without Participants<br>* Penalty: Registered Guild &amp; Real Guild Abolition is declared Knocked Down in that Period<br><br>7. All Player Mistakes in the game such as; [All Categories Below are not the responsibility of the Admin]<br>* Notifying ID &amp; Password to Other Parties, Errors in Vending Prices, Errors in Throwing / Selling<br><br>8. Market Rules: RMT is allowed, but prices are Privacy By Private Massage<br><br>9. It is prohibited to take advantage of bugs or errors found in the game for the benefit of yourself / group<br>* Punishment: 7 Days Banned - Permanently Banned<br><br>10. Hacking, cheating, using bots, or participating in any illegal activity in the game is prohibited<br>* Macro / key recorders that put other players at a disadvantage in certain situations or for Auto Hunt purposes will also get you banned<br>* Punishment: 7 Days Banned - Permanently Banned </span></span><br></p>', 'assets/frontpage/img/notice/4.', '2019-05-26'),
(28, 'Download Page', 'Page', 'download-page', 'yes', '<h2 style=\"text-align: center;\"><span style=\"color: rgb(0, 123, 255);\">Great Luna Download Information</span></h2>\r\n                                    <span><hr style=\"border:1px dashed #fff;\"></span><span style=\"color: rgb(221, 134, 4);\">On Progress</span>', 'assets/frontpage/img/notice/download-page.', '2019-12-10'),
