(39, 'Close Beta', 'News', 'close-beta', 'yes', '<p align=\"justify\"></p><h2 class=\"color-red\" gentium=\"\" basic\",=\"\" serif;=\"\" font-weight:=\"\" bold;=\"\" line-height:=\"\" 1.1;=\"\" margin-top:=\"\" 4px;=\"\" margin-bottom:=\"\" 10px;=\"\" font-size:=\"\" 30px;=\"\" text-align:=\"\" center;=\"\" color:=\"\" rgb(240,=\"\" 56,=\"\" 56)=\"\" !important;\"=\"\" style=\"text-align: center;\"><span style=\"color: rgb(0, 123, 255);\"><span style=\"background-color: inherit;\">GREAT LUNA ONLINE CLOSE BETA</span></span><br></h2><div style=\"text-align: center;\"><span style=\"color: rgb(221, 134, 4);\"><span style=\"background-color: inherit;\"></span></span></div><p style=\"text-align: center;\"></p><p style=\"margin-bottom: 10px; color: rgb(131, 115, 106); text-align: center;\"><span style=\"color: rgb(221, 134, 4);\"><span style=\"background-color: inherit;\">Close Beta Information to all greaters , We will update this info soon , thanks for attention</span></span></p><p align=\"justify\"><span style=\"color: rgb(221, 134, 4);\"><span style=\"background-color: inherit;\"></span></span></p>', 'assets/frontpage/img/notice/close_beta.png', '2021-04-17'),
(43, 'Welcome To Great Luna Online', 'Overview', NULL, 'yes', '<h2 style=\"text-align: center;\"><span style=\"color: rgb(0, 123, 255);\">Great Luna Online [CLASSIC SYSTEM]</span></h2>\r\n<span><hr style=\"border:1px dashed #fff;\"></span>\r\n                            <p style=\"margin-bottom: 10px; text-align: center;\"><span style=\"color: rgb(221, 134, 4);\"><span style=\"\"><span style=\"\">Very Great System Classic Luna with added more feature on game never make you boring we waiting you guys to join with us later.</span></span></span></p><span style=\"color: rgb(221, 134, 4);\">\r\n                            </span><p style=\"margin-bottom: 10px; text-align: center;\"><span style=\"\"><span style=\"\"><span style=\"color: rgb(221, 134, 4);\"><br></span></span></span></p><p style=\"margin-bottom: 10px; text-align: center;\"><span style=\"\"><span style=\"\"><span style=\"color: rgb(221, 134, 4);\">#GreatLunaOnline</span><br></span></span></p>', 'assets/frontpage/img/notice/.', '2021-06-02'),
(44, 'Server Specifications', 'Overview', NULL, 'yes', '<p align=\"justify\"></p><p align=\"justify\">\r\n                                    </p><h2 style=\"text-align: center;\"><span style=\"color: rgb(0, 123, 255);\">Great Luna Online [CLASSIC SYSTEM]</span></h2>\r\n                                    <span><hr style=\"border:1px dashed #fff;\"></span><div><span style=\"color: rgb(221, 134, 4);\">- Server : Singapore [ International Server ]</span></div><div><span style=\"color: rgb(221, 134, 4);\">- Level Cap : 120</span></div><div><span style=\"color: rgb(221, 134, 4);\">- Rate Exp : x12</span></div><div><span style=\"color: rgb(221, 134, 4);\">- Rate Drop : x10</span></div><div><span style=\"color: rgb(221, 134, 4);\">- Rate Gold Drop : x5</span></div><div><span style=\"color: rgb(221, 134, 4);\">- Rate Exp Party : x20</span></div><hr style=\"border:1px dashed #fff;\">\r\n                                    <p align=\"justify\"></p><p align=\"justify\"><span style=\"color: rgb(221, 134, 4);\">[ Optional / Setting ]</span></p><p align=\"justify\"><span style=\"color: rgb(221, 134, 4);\">- Luna Type Damage [ CLASSIC ]</span></p><p align=\"justify\"><span style=\"color: rgb(221, 134, 4);\">- WASD On/Off</span></p><p align=\"justify\"><span style=\"color: rgb(221, 134, 4);\">- Weather On/Off</span></p><p align=\"justify\"><span style=\"color: rgb(221, 134, 4);\">- Inspect Item On/Off/Block</span></p><p align=\"justify\"><span style=\"color: rgb(221, 134, 4);\">- Balance PVE &amp; PVP System Modified</span></p><p align=\"justify\"><span style=\"color: rgb(221, 134, 4);\">- Game Update Weekly / Montly Active</span></p><p align=\"justify\"><span style=\"background-color: inherit; color: rgb(221, 134, 4);\"></span></p><p align=\"justify\"><span style=\"color: rgb(221, 134, 4);\">- Smooth Visual 30/60 FPS Active</span></p><p align=\"justify\"><span style=\"color: rgb(221, 134, 4);\"><br></span></p><p align=\"justify\"><span style=\"color: rgb(221, 134, 4);\">[ Feature Added ]</span></p><p align=\"justify\"><span style=\"color: rgb(221, 134, 4);\">- Castle Siege&nbsp;</span></p><p align=\"justify\"><span style=\"color: rgb(221, 134, 4);\">- Guild Tournament</span></p><p align=\"justify\"><span style=\"color: rgb(221, 134, 4);\">- Daily Quest</span></p><p align=\"justify\"><span style=\"color: rgb(221, 134, 4);\">- New Box&nbsp;</span></p><p align=\"justify\"><span style=\"color: rgb(221, 134, 4);\">- New Npc</span></p><p align=\"justify\"><span style=\"color: rgb(221, 134, 4);\">- New Costume Effect</span></p><p align=\"justify\"><span style=\"color: rgb(221, 134, 4);\">- Quick Change Job NPC</span></p><p align=\"justify\"><span style=\"color: rgb(221, 134, 4);\">- Free Buffer NPC @Gate Alker</span></p><p align=\"justify\"><span style=\"color: rgb(221, 134, 4);\">- Max Bag 5</span></p><p align=\"justify\"></p><p align=\"justify\"><span style=\"color: rgb(221, 134, 4);\">- Max Login 3</span></p><p align=\"justify\"></p>', 'assets/frontpage/img/notice/.', '2021-06-02'),
